import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


class App extends Component {
  render() {
    return (
      <div className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <form>
            City
            <input type="text" >
            </input>
          </form>
      </div>
    );
  }
}

export default App;
